import React from "react";


const Card = () => {
    return (
        <div className="App">
            <header className="App-header">

                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    HIIIIIII
                </a>
            </header>
        </div>
    );
}

export default Card;
